import { Container, Paper, Typography } from '@mui/material';
import React from 'react'

import {
    BrowserRouter as Router,
    Route,
    Routes
} from "react-router-dom";

import ProfileImage from '../Assests/profile.png'
import styled from '@emotion/styles';

const ProfilePhotoWrap = styled('img')(() => ({
    width: 150,
    height: 150,
    borderRadius: '100%',
    overflow: 'hidden',
    marginRight: 20
}))

const CustomizedPaper = styled(Paper)(({ theme }) => ({
    padding: 5,
    display: 'flex',
    alignItems: 'center',
    borderRadius: 3,
    [theme.breakpoints.up('lg')]: {
        backgroundColor: "#555",
      },
}))

export default function Profile() {
    return (
        <Container fixed>
            <CustomizedPaper elevation="24">
                <ProfilePhotoWrap src={ProfileImage} alt='Prifile picture' />
                <Container >
                    <Typography fontWeight={700} variant='h3'>Username</Typography>
                    <Typography fontWeight={500} variant='body1'>#WalletNumber</Typography>
                </Container>
            </CustomizedPaper>
        </Container>
    )
}
